import { useState, useEffect } from "react";

export const Products = (props) => {

    console.log(props.items);


    return(
        <div>
            {props.items.map((item) => (
                <div key={item.carClassId}>
                    <img src = {item.image}/>
                    <p>{item.carClassName}</p>
                    <p>{item.carModel}</p>
                    <p>{item.carTypeTags}</p>
                    <p>{item.discountPercent}</p>
                    <p>{item.drivingDistance}</p>
                    <p>{item.price}</p>
                    <p>{item.regionGroups}</p>
                    <p>{item.year}</p>
                </div>    
            ))}

        </div>
    );
}

export default Products;
